      })
      .catch((error) => {
        console.log(error);
      });
   
  };

  const doDoctorSearch = () => {
    setQuery({
      department: department,
      designation: designation,
      name: name,
      area: area,
    });
  };

  useEffect(() => {
   
    loadDoctors();
  }, [query]);

